import { Injectable } from '@nestjs/common';
import { ClientService } from '@hsuite/client';
import { SmartNodeSdkService } from '@hsuite/smartnode-sdk';
import { SmartConfigService } from '@hsuite/smart-config';
import { Transaction, PrivateKey, Client, TokenInfo, LedgerId } from '@hashgraph/sdk';
import { HashgraphClientHelper } from '@hsuite/helpers';
import { LoggerHelper } from '@hsuite/helpers';
import { IHashgraph } from '@hsuite/hashgraph-types';
import * as exampleTokensValidator from './validators/example.tokens.validator.json';

/**
 * @class TokensService
 * @description Service for showcasing Hedera Token Service (HTS) operations
 * 
 * This service demonstrates how to use the SmartNodeSdkService to interact with
 * the Hedera Token Service for:
 * - Creating fungible tokens
 * - Creating non-fungible tokens (NFTs)
 * - Minting tokens and NFTs
 * - Transferring tokens between accounts
 * - Managing token properties and permissions
 * - Querying token information
 * 
 * Each method includes detailed documentation and example usage to help developers
 * understand how to implement token functionality in their own applications.

* 
 * @example
 * ```typescript
 * // Inject the service
 * constructor(private tokensService: TokensService) {}
 * 
 * // Use the service to create and manage tokens
 * async createAndMintToken() {
 *   const tokenId = await this.tokensService.createToken({
 *     name: 'Example Token',
 *     symbol: 'EXT',
 *     decimals: 2,
 *     initialSupply: 1000
 *   });
 *   
 *   await this.tokensService.mintFungibleTokens({
 *     tokenId: tokenId,
 *     amount: 500
 *   });
 *   
 *   const tokenInfo = await this.tokensService.getTokenInfo(tokenId);
 *   return tokenInfo;
 * }
 * ```
 */
@Injectable()
export class TokensService {
  /**
   * Logger instance for service operations
   * @private
   * @readonly
   */
  private readonly logger = new LoggerHelper(TokensService.name);

  /**
   * Hedera client instance for network interactions
   * @private
   */
  private client: Client;

  /**
   * Operator credentials for transaction signing
   * @private
   * @remarks Contains the account ID and private key used for signing transactions
   */
  private operator: IHashgraph.IOperator;

  /**
   * Creates an instance of the TokensService
   * 
   * @param clientService - Client service for API communication
   * @param smartConfigService - Configuration service for network settings
   * @param smartNodeSdkService - SDK service for Hedera network operations
   * 
   * @example
   * ```typescript
   * // NestJS dependency injection will handle instantiation
   * @Module({
   *   providers: [TokensService],
   *   exports: [TokensService]
   * })
   * export class TokensModule {}
   * ```
   */
  constructor(
    private readonly clientService: ClientService,
    private readonly smartConfigService: SmartConfigService,
    private readonly smartNodeSdkService: SmartNodeSdkService
  ) {
    this.operator = this.smartConfigService.getOperator();

    HashgraphClientHelper.initialize(
      LedgerId.fromString(this.smartConfigService.getEnvironment()),
      this.operator,
      this.smartConfigService.getMirrorNode()
    );

    this.client = HashgraphClientHelper.getInstance().getClient();  
  }

  /**
   * Creates a new fungible token on the Hedera network
   * 
   * @param {Omit<IHashgraph.ILedger.IHTS.ICreate, 'validatorConsensusTimestamp'>} params - Token creation parameters including:
   *   - name: Token name
   *   - symbol: Token symbol (ticker)
   *   - decimals: Number of decimal places
   *   - initialSupply: Initial token supply
   *   - treasuryAccountId: (Optional) Account to receive initial supply
   *   - adminKey: (Optional) Key for token administration
   *   - kycKey: (Optional) Key for KYC verification
   *   - freezeKey: (Optional) Key for freezing token transfers
   *   - wipeKey: (Optional) Key for wiping tokens
   *   - supplyKey: (Optional) Key for minting/burning tokens
   *   - feeScheduleKey: (Optional) Key for updating fee schedule
   *   - customFees: (Optional) Array of custom fees
   * 
   * @returns {Promise<string>} The ID of the created token in the format 0.0.X
   * 
   * @throws {Error} If token creation fails due to:
   * - Network connectivity issues
   * - Invalid operator credentials
   * - Transaction execution failure
   * - Invalid token parameters
   * - Insufficient gas/fees
   * 
   * @example
   * ```typescript
   * // Create a token with custom treasury
   * const tokenId = await tokensService.createToken({
   *   name: 'My Token',
   *   symbol: 'MTK',
   *   decimals: 2,
   *   initialSupply: 1000,
   *   treasuryAccountId: '0.0.12345',
   *   adminKey: {
   *     key: operatorPublicKey
   *   }
   * });
   * 
   * // Create a token with operator as treasury
   * const defaultTokenId = await tokensService.createToken({
   *   name: 'Default Token',
   *   symbol: 'DFT',
   *   decimals: 0,
   *   initialSupply: 1000000
   * });
   * ```
   */
  async createToken(
    params: Omit<IHashgraph.ILedger.IHTS.ICreate, 'validatorConsensusTimestamp'>
  ): Promise<string> {
    try {
      const validatorConsensusTimestamp = await this.smartNodeSdkService.validatorsRestful
        .addTokenValidator(exampleTokensValidator as any);

      // Generate transaction bytes using the Smart Node SDK
      const createTokenTxBytes = await this.smartNodeSdkService.htsHashgraphRestful.createToken({
        ...params,
        validatorConsensusTimestamp
      });

      // Convert bytes to transaction object
      const createTokenTx = Transaction.fromBytes(
        new Uint8Array(Buffer.from(createTokenTxBytes))
      );

      // Sign the transaction with operator key
      const signedTx = await createTokenTx.sign(
        PrivateKey.fromString(this.operator.privateKey)
      );

      // Execute the transaction and get receipt
      const txResponse = await signedTx.execute(this.client);
      const receipt = await txResponse.getReceipt(this.client);

      // Return the new token ID
      return receipt.tokenId.toString();
    } catch (error) {
      this.logger.error(`Failed to create fungible token: ${error.message}`);
      throw error;
    }
  }

  /**
   * Mints additional tokens for a fungible token
   * 
   * @param {IHashgraph.ILedger.IHTS.IFungibleToken.IMint} params - Token minting parameters including:
   *   - tokenId: ID of the token to mint additional supply for
   *   - amount: Amount of tokens to mint
   *   - metadata: (Optional) Metadata for the minting operation
   * 
   * @returns {Promise<string>} The transaction ID of the mint operation
   * 
   * @throws {Error} If minting fails due to:
   * - Network connectivity issues
   * - Invalid operator credentials
   * - Transaction execution failure
   * - Invalid token ID or amount
   * - Insufficient permissions (requires supply key)
   * 
   * @example
   * ```typescript
   * // Mint additional tokens
   * const txId = await tokensService.mintFungibleTokens({
   *   tokenId: '0.0.12345',
   *   amount: 500
   * });
   * console.log(`Minted 500 additional tokens, transaction: ${txId}`);
   * 
   * // Mint a large amount of tokens
   * const largeTxId = await tokensService.mintFungibleTokens({
   *   tokenId: '0.0.12345',
   *   amount: 1000000
   * });
   * ```
   */
  async mintFungibleTokens(
    params: IHashgraph.ILedger.IHTS.IFungibleToken.IMint
  ): Promise<string> {
    try {
      // Generate transaction bytes for minting tokens
      const mintTxBytes = await this.smartNodeSdkService.htsHashgraphRestful.mintToken(params);

      // Convert bytes to transaction object
      const mintTx = Transaction.fromBytes(
        new Uint8Array(Buffer.from(mintTxBytes))
      );

      // Sign transaction with operator key
      const signedTx = await mintTx.sign(
        PrivateKey.fromString(this.operator.privateKey)
      );

      // Execute transaction
      const txResponse = await signedTx.execute(this.client);

      // Return the transaction ID
      return txResponse.transactionId.toString();
    } catch (error) {
      this.logger.error(`Failed to mint tokens: ${error.message}`);
      throw error;
    }
  }

  /**
   * Gets information about a specific token
   * 
   * @param {string} tokenId - ID of the token to query in the format 0.0.X
   * 
   * @returns {Promise<TokenInfo>} Detailed information about the token including:
   *   - name: Token name
   *   - symbol: Token symbol
   *   - decimals: Number of decimal places
   *   - totalSupply: Current total supply
   *   - treasuryAccountId: Treasury account
   *   - adminKey: Admin key (if present)
   *   - kycKey: KYC key (if present)
   *   - freezeKey: Freeze key (if present)
   *   - wipeKey: Wipe key (if present)
   *   - supplyKey: Supply key (if present)
   *   - defaultFreezeStatus: Whether accounts are frozen by default
   *   - defaultKycStatus: Whether accounts have KYC by default
   *   - tokenType: Type of token (FUNGIBLE_COMMON, NON_FUNGIBLE_UNIQUE)
   *   - supplyType: Supply type (FINITE, INFINITE)
   *   - maxSupply: Maximum supply (if finite)
   * 
   * @throws {Error} If token information retrieval fails due to:
   * - Network connectivity issues
   * - Invalid token ID
   * - Token not found
   * - Node unavailability
   * 
   * @example
   * ```typescript
   * // Get basic token information
   * const tokenInfo = await tokensService.getTokenInfo('0.0.12345');
   * console.log(`Token name: ${tokenInfo.name}`);
   * console.log(`Total supply: ${tokenInfo.totalSupply.toString()}`);
   * console.log(`Decimals: ${tokenInfo.decimals}`);
   * 
   * // Check token properties
   * if (tokenInfo.adminKey) {
   *   console.log('Token has admin key configured');
   * }
   * if (tokenInfo.kycKey) {
   *   console.log('Token has KYC key configured');
   * }
   * if (tokenInfo.supplyKey) {
   *   console.log('Token supply can be modified');
   * }
   * ```
   */
  async getTokenInfo(tokenId: string): Promise<TokenInfo> {
    try {
      // Use the Smart Node SDK to query token information
      return await this.smartNodeSdkService.htsHashgraphRestful.getTokenInfo(tokenId);
    } catch (error) {
      this.logger.error(`Failed to retrieve token info: ${error.message}`);
      throw error;
    }
  }
}

import { 
  Controller, 
  Get, 
  Post, 
  Body, 
  Param, 
  BadRequestException, 
  Query
} from '@nestjs/common';
import { TopicsService } from './topics.service';
import { Hashgraph, IHashgraph } from '@hsuite/hashgraph-types';
import { LoggerHelper } from '@hsuite/helpers';
import { 
  ApiTags, 
  ApiOperation, 
  ApiBody, 
  ApiParam, 
  ApiOkResponse, 
  ApiBadRequestResponse, 
  ApiNotFoundResponse 
} from '@nestjs/swagger';

/**
 * Controller responsible for handling Hedera Consensus Service (HCS) topic operations. * 
 * This controller provides endpoints for demonstrating HCS functionality including:
 * - Creating and managing topics
 * - Submitting messages to topics
 * - Retrieving topic information and messages
 * 
 * These endpoints serve as examples of how to integrate HCS with your applications
 * and demonstrate best practices for topic management. *
 * @class TopicsController
 * @description Handles all HCS topic-related HTTP endpoints
 */
@ApiTags('Hedera Consensus Service')
@Controller('topics')
export class TopicsController {
  private readonly logger = new LoggerHelper(TopicsController.name);

  /**
   * Creates an instance of TopicsController. * 
   * @param {TopicsService} topicsService - The service handling HCS topic operations
   * @constructor
   */
  constructor(private readonly topicsService: TopicsService) {}

  /**
   * Creates a new topic on the Hedera network. * 
   * This endpoint allows for the creation of a new HCS topic with optional
   * configuration. The topic is created using the operator account credentials
   * configured in the application.

* 
   * @param {IHashgraph.ILedger.IHCS.ITopic.ICreate} params - Request body containing topic creation parameters
   * @returns {Promise<string>} A promise resolving to the new topic ID
   * @throws {BadRequestException} If topic creation fails
   * 
   * @example
   * // Create topic with custom memo
   * POST /topics/create
   * Body: { 
   *   "memo": "My Application Messages",
   *   "validatorConsensusTimestamp": "2024-01-01T00:00:00.000Z"
   * }
   */
  @ApiOperation({
    summary: 'Create a new HCS topic',
    description: 'Creates a new topic on the Hedera network with optional configuration'
  })
  @ApiBody({
    type: Object,
    required: true,
    description: 'Topic creation parameters including optional memo and timestamp'
  })
  @ApiOkResponse({
    type: String,
    description: 'The newly created topic ID in the format 0.0.12345'
  })
  @ApiBadRequestResponse({
    description: 'Invalid topic creation parameters or network error'
  })
  @Post('create')
  async createTopic(
    @Body() params: IHashgraph.ILedger.IHCS.ITopic.ICreate
  ): Promise<string> {
    try {
      return await this.topicsService.createTopic(params);
    } catch (error) {
      this.logger.error(`Failed to create topic: ${error.message}`);
      throw new BadRequestException(error.message);
    }
  }

  /**
   * Submits a message to an existing topic. * 
   * This endpoint facilitates the submission of messages to HCS topics. * The message is submitted using the operator account as the sender.

* 
   * @param {IHashgraph.ILedger.IHCS.ITopic.IMessage.ISubmit} params - Message submission parameters
   * @returns {Promise<string>} A promise resolving to the transaction ID
   * @throws {BadRequestException} If message submission fails
   * 
   * @example
   * // Submit a message to topic 0.0.12345
   * POST /topics/submit
   * Body: { 
   *   "topicId": "0.0.12345",
   *   "message": "Hello Hedera!"
   * }
   */
  @ApiOperation({
    summary: 'Submit message to topic',
    description: 'Submits a message to an existing HCS topic'
  })
  @ApiBody({
    type: Hashgraph.Ledger.HCS.Topic.Message.Submit,
    required: true,
    description: 'Message submission details including topic ID and message content'
  })
  @ApiParam({
    name: 'topicId',
    type: String,
    required: true,
    description: 'The HCS topic ID in the format 0.0.12345'
  })
  @ApiOkResponse({
    type: String,
    description: 'Transaction ID of the completed message submission'
  })
  @ApiBadRequestResponse({
    description: 'Invalid message parameters or network error'
  })
  @Post('submit/:topicId')
  async submitMessage(
    @Param('topicId') topicId: string,
    @Body() params: IHashgraph.ILedger.IHCS.ITopic.IMessage.ISubmit
  ): Promise<string> {
    try {
      return await this.topicsService.submitMessage(topicId, params);
    } catch (error) {
      this.logger.error(`Failed to submit message: ${error.message}`);
      throw new BadRequestException(error.message);
    }
  }

  /**
   * Retrieves messages from a specific topic. * 
   * This endpoint queries the Hedera network for messages from a topic,
   * including their content, sequence numbers, and timestamps.

* 
   * @param {string} topic - The HCS topic ID in the format 0.0.12345
   * @param {string} encoding - Message encoding format
   * @param {number} limit - Maximum number of messages
   * @param {string} order - Sort order (asc/desc)
   * @param {number} sequenceNumber - Starting sequence number
   * @param {string} timestamp - Starting timestamp
   * @returns {Promise<Hashgraph.Restful.HCS.Message.Entity[]>} A promise resolving to the topic messages
   * @throws {BadRequestException} If message retrieval fails
   * 
   * @example
   * // Get messages from topic 0.0.12345
   * POST /topics/messages
   * Body: {
   *   "topicId": "0.0.12345",
   *   "start": 0,
   *   "end": 10,
   *   "callbackSuccess": (msg) => console.log(msg),
   *   "callbackError": (msg, err) => console.error(err)
   * }
   */
  @ApiOperation({
    summary: 'Get topic messages',
    description: 'Retrieves messages from a specific HCS topic'
  })
  @ApiBody({
    type: Object,
    required: true,
    description: 'Message retrieval parameters including topic ID and range'
  })
  @ApiOkResponse({
    type: Array,
    description: 'Array of messages with their content and metadata'
  })
  @ApiNotFoundResponse({
    description: 'Topic not found on the Hedera network'
  })
  @ApiBadRequestResponse({
    description: 'Invalid topic ID or network error'
  })
  @Post('messages')
  async getTopicMessages(
    @Param('topic') topic: string,
    @Query('encoding') encoding?: string,
    @Query('limit') limit?: number,
    @Query('order') order?: string,
    @Query('sequenceNumber') sequenceNumber?: number,
    @Query('timestamp') timestamp?: string
  ): Promise<Hashgraph.Restful.HCS.Message.Entity[]> {
    try {
      return await this.topicsService.getTopicMessages(
        topic,
        encoding,
        limit,
        order,
        sequenceNumber,
        timestamp
      );
    } catch (error) {
      this.logger.error(`Failed to get topic messages: ${error.message}`);
      throw new BadRequestException(error.message);
    }
  }

  /**
   * Retrieves detailed information about a specific topic.

* 
   * This endpoint queries the Hedera network for comprehensive information about
   * a topic, including its configuration, state, and associated resources. * 
   * @param {string} topicId - The HCS topic ID to query
   * @returns {Promise<IHashgraph.ILedger.IHCS.ITopic.IInfo>} A promise resolving to detailed topic information
   * @throws {BadRequestException} If topic information retrieval fails
   * 
   * @example
   * // Get detailed information for topic 0.0.12345
   * GET /topics/0.0.12345/info
   */
  @ApiOperation({
    summary: 'Get topic information',
    description: 'Retrieves detailed information about a specific HCS topic'
  })
  @ApiParam({
    name: 'topicId',
    type: String,
    required: true,
    description: 'The HCS topic ID in the format 0.0.12345'
  })
  @ApiOkResponse({
    type: Object,
    description: 'Detailed topic information including configuration and state'
  })
  @ApiNotFoundResponse({
    description: 'Topic not found on the Hedera network'
  })
  @ApiBadRequestResponse({
    description: 'Invalid topic ID or network error'
  })
  @Get(':topicId/info')
  async getTopicInfo(
    @Param('topicId') topicId: string
  ): Promise<IHashgraph.ILedger.IHCS.ITopic.IInfo> {
    try {
      return await this.topicsService.getTopicInfo(topicId);
    } catch (error) {
      this.logger.error(`Failed to get topic info: ${error.message}`);
      throw new BadRequestException(error.message);
    }
  }
}

import { Module } from '@nestjs/common';
import { TopicsController } from './topics.controller';
import { TopicsService } from './topics.service';

/**
 * @class TopicsModule
 * @description Module for managing Hedera Consensus Service (HCS) operations
 * 
 * This module provides a complete solution for interacting with the Hedera Consensus Service,
 * including topic creation, message submission, and information retrieval. It integrates with
